import "./App.css";
import axios from "axios";
import React, { useEffect, useState } from "react";
import Button from "./UI/Button";
import Card from "./UI/Card";

function App() {
  const [vehicles, setVehicles] = useState([]);
  const [occupy, setOccupy] = useState(false);

  const getVehicles = async () => {
    const { data } = await axios("/vehicles/list");
    console.log(data);
    setVehicles(data);
  };
  const occupyVehicle = () => {
    setOccupy(!occupy);

    console.log("occupy Vehicle");
    // axios.get(`https://jsonplaceholder.typicode.com/users`)
    // .then(res => {
    //   const persons = res.data;
    //   this.setState({ persons });
    // })
  };
  const releaseVehicle = () => {
    console.log("release Vehicle");
    // axios.get()
  };

  const renderVehicles = (_vehicles) => {
    return _vehicles.map((v) => {
      return (
        <div className="vehicles-wrapper">
          <Card>
            <div>

            <p>manufacturer: {v.manufacturer}</p>
            <p>license plate number: {v.license_plate_number}</p>
            </div>
            <p>
              {/* is available:  */}
              <div className="buttons-wrapper">
                {console.log("pppp", v.is_available, v.manufacturer)}
                {console.log("pppp")}
                {/* if available=true  Occupy button will showen  */}
                {/* if available=false && user is owner - Release will showen */}
                <div className="occupy-wrapper">
                  <Button
                    className={
                      "button " +
                      (v.is_available ? "available" : "not-available")
                    }
                    onClick={occupyVehicle}
                  >
                    Occupy
                  </Button>

                  {/* <span
                    className={!v.is_available ? "not-available-text" : "text-disable"}
                  >
                    Vehicle is not available
                  </span> */}
                </div>
                <div className="release-wrapper">
                  <Button
                    className={
                      "button " + (v.is_available ? "available-and-owner" : "")
                    }
                    onClick={releaseVehicle}
                  >
                    Release
                  </Button>
                </div>
              </div>
            </p>
          </Card>
        </div>
      );
    });
  };

  useEffect(() => {
    getVehicles();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h2>Vehicles list </h2>
      </header>
      {renderVehicles(vehicles)}
    </div>
  );
}

export default App;
